class Solution(object):
    def compressedString(self, word):
        """
        :type word: str
        :rtype: str
        """
        # pre-process
        L = len(word)
        compresses = list()

        # process
        idx = 0
        while idx < L:
            idx2 = 0
            while idx + idx2 < L and idx2 < 9 and word[idx] == word[idx + idx2]:
                idx2 += 1
            compresses.append(str(idx2) + word[idx])
            idx += idx2

        # print(compresses)
        ans = "".join(compresses)
        return ans


word = "abcde"
word = "aaaaaaaaaaaaaabb"
word = "a"
word = ""

solution = Solution()
print(solution.compressedString(word))
